    false,nt"url": null,nt"notes": "During 1979, Chevron Resources Company
    drilled two 2000 ft. holes near Soda Lake in the Nevada Carson Sink area to obtain
    subsurface data for inclusion in the U.S. Department of Energy's Northern Basin
    and Range geothermal reservoir assessment program. Drilling information together
    with detailed lithologic, geophysical and temperature log data were compiled for
    each hole and Is summarized in this report. Maximum stabilized temperatures of 297u00b0F
    and 367u00b0F were encountered at total depth in each of the holes respectively.",nt"license_title":
